    if (index === 0) {
      return "fade-left";
    } else if (index === 1) {
      return "fade-up";
    } else if (index === 2) {
      return "fade-right";
    } else {
      return "fade-up";
    }
  };

const Team10  = (props) => {
    const itemSlice = data.slice(0 , props.item)
